import './App.css';
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

import Home from "./pages/Home";
import Ingredients from "./pages/Ingredients";
import Products from './pages/Products';
import Recipes from './pages/Recipes';
import AddIngredient from './pages/AddIngredient';
import AddProduct from './pages/AddProduct';
import AddRecipe from './pages/AddRecipe';
import Ingredient from './pages/Ingredient';
import Product from './pages/Product';
import Recipe from './pages/Recipe';

function App() {


  return (
    <div className='App'>
      <Router>
        <Link to="/addingredient">AddIngredient</Link>
        <Link to="/addproduct">AddProduct</Link>
        <Link to="/addrecipe">AddRecipe</Link>
        <Link to="/">Homepage</Link>
        <Link to="/ingredients">Ingredients</Link>
        <Link to="/products">Products</Link>
        <Link to="/recipes">Recipes</Link>
        {/* <Link to="/ingredient">Ingredient</Link> */}



        <Routes>
          <Route path="/" exact element={<Home/>} />
          <Route path="/ingredients" exact element={<Ingredients/>} />
          <Route path="/addingredient" exact element={<AddIngredient/>}/>
          <Route path="/addproduct" exact element={<AddProduct/>}/>
          <Route path="/addrecipe" exact element={<AddRecipe/>}/>
          <Route path="/products" exact element={<Products/>} />
          <Route path="/recipes" exact element={<Recipes/>} />
          <Route path="/ingredient/:id" exact element={<Ingredient/>}/>
          <Route path="/product/:id" exact element={<Product/>}/>
          <Route path="/recipe/:id" exact element={<Recipe/>}/>


        </Routes>
      </Router>
    </div>
  );
}

export default App;
